    try {
      const Allreport = await Axios.get(
        "http://localhost:7000/post/report/non_verify"
      );
      setReport(Allreport.data.report);
      console.log(Allreport.data.report);
    } catch (err) {
      console.log("error");
    }
  };

  useEffect(() => {
    initReport();
  }, []);
  return (
    <div>
      <div className="container-history1">
        <div className="container-history2">
          <Form className="formsize-history">
            <Form.Row>
              <Form.Group
                as={Col}
                className="้history-left col-lg-6 col-12"
                controlId="formGridName"
              >
                <Form.Label>ผุ้แจ้งการรายงาน : </Form.Label>
              </Form.Group>

              <Form.Group>
                <span className="spanhistory">
                  {/* {ok.name} {ok.surname} */}
                </span>
              </Form.Group>
            </Form.Row>
          </Form>
        </div>
      </div>
    </div>
  );
};

export default Non_listverifypost;
